import Button from "../../component/Button/Button";
import cerImg from "../../img/bmw-blac.jpeg";
import {Link} from "react-router-dom";
import './blog.scss'

import {isMobile} from 'react-device-detect';

import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";

// import "./styles.css";

// import required modules
import { Pagination } from "swiper";

function Blog() {
    console.log(isMobile)
    if(isMobile){
        const pagination = {
            clickable: true,
            renderBullet: function (index, className) {
                return '<span class="' + className + '">' + (index + 1) + "</span>";
            },
        };
        return (
            <>
                <section>
                    <h2>Blog page Mobile</h2>
                    <div className="box">
                        <h2>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Non, optio.</h2>
                        <Button name="Hello"/>
                        <Button/>
                        <Button className="header__button" name='Open'/>
                        <Link to='/blog'>Blog</Link>
                    </div>
                    <div className="blog__swiper">
                        <Swiper
                            pagination={pagination}
                            modules={[Pagination]}
                            className="mySwiper">
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                        </Swiper>
                    </div>
                </section>
            </>
        )
    } else  {
        const pagination = {
            clickable: true,
            renderBullet: function (index, className) {
                return '<span class="' + className + '">' + (index + 1) + "</span>";
            },
        };
        return (
            <>
                <section>
                    <h2>Blog page Desctop</h2>
                    <div className="box">
                        <h2>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Non, optio.</h2>
                        <Button name="Hello"/>
                        <Button/>
                        <Button className="header__button" name='Open'/>
                        <Link to='/blog'>Blog</Link>
                    </div>
                    <div className="blog__swiper">
                        <Swiper
                            pagination={pagination}
                            modules={[Pagination]}
                            className="mySwiper">
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                            <SwiperSlide><img src={cerImg} alt=""/></SwiperSlide>
                        </Swiper>
                    </div>
                </section>
            </>
        )
    }

}
export default Blog
